import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
} from '@mui/material';
import { styled } from '@mui/material/styles';

const StyledButton = styled(Button)(({ theme }) => ({
  borderRadius: '24px',
  padding: '8px 16px',
  textTransform: 'none',
  fontSize: '16px',
}));

const Navbar = () => {
  return (
    <AppBar position="static" color="transparent" elevation={0}>
      <Toolbar>
        <Typography
          variant="h6"
          component={RouterLink}
          to="/"
          sx={{
            flexGrow: 1,
            fontWeight: 'bold',
            textDecoration: 'none',
            color: 'inherit',
          }}
        >
          Real-Time Traffic Sign Detection
        </Typography>
        <Box>
          <StyledButton
            component={RouterLink}
            to="/"
            color="inherit"
            sx={{ mr: 2 }}
          >
            Home
          </StyledButton>
          <StyledButton
            component={RouterLink}
            to="/features"
            color="inherit"
            sx={{ mr: 2 }}
          >
            Features
          </StyledButton>
          <StyledButton
            component={RouterLink}
            to="/how-it-works"
            color="inherit"
            sx={{ mr: 2 }}
          >
            How It Works
          </StyledButton>
          <StyledButton
            component={RouterLink}
            to="/account"
            color="primary"
            variant="contained"
          >
            My Account
          </StyledButton>
        </Box>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
